    "src/undergroundMulticall.sol": {
      "content": "// SPDX-License-Identifier: MIT\npragma solidity ^0.8.19;\n\ninterface ug {\n    struct Subscription {\n        bool minted;\n        uint256 expiration;\n        uint256 lock;\n    }\n\n    function subscription(uint256) external view returns (Subscription memory);\n}\n\ncontract undergroundMulticall {\n\n    ug constant underground = ug(0x018602173a73ad5A9117f9eF9E250c4d23539a1C);\n\n    function getSubscriptions(uint256 startIndex, uint256 endIndex) external view returns(ug.Subscription[] memory) {\n        uint256 len = endIndex - startIndex;\n\n        ug.Subscription[] memory subs = new ug.Subscription[](len);\n\n        for(uint256 i = 0; i < len; i++) {\n            subs[i] = underground.subscription(startIndex + i);\n        }\n\n        return subs;\n    }\n}"
